import React from 'react'

const Filter = ({ searchName, handleSearchName }) => {

    return (
        <div>
            <form>
                <div>
                    Filter shown with: <input value={searchName} onChange={handleSearchName} />
                </div>
            </form>
        </div>
    )
}

export default Filter
